import {Action} from '../actions/index.js';
const oldState = {
    data:[],
    error: false,
}
export const reducer = (state = oldState, action)=>{
    switch (action.type) {
        case 'getDataSuccess':
            return state;
        case 'getDataSuccess':
            return state;    
        default:
            return state;
    }
}
